import React, { useState } from "react";
import "./index.css";

interface guh {
  visible: boolean;
  tabState: number;
}

const Modal = ({ visible, tabState }): guh => {
  return <div className={{ visible } ? "modalopen" : "modalclosed"}>guh</div>;
};

export default Modal;
